import React, { useState } from 'react';

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [errorMessage, setErrorMessage] = useState('');
  const [successMessage, setSuccessMessage] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setErrorMessage('');
    setSuccessMessage('');

    try {
      const response = await fetch('http://localhost:8000/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ email, password }),
      });

      const data = await response.json();

      if (!response.ok) {
        setErrorMessage(data.detail || 'Erro ao fazer login.');
      } else {
        setSuccessMessage(data.message);
        // Aqui você poderia redirecionar para outra página, se quiser
      }
    } catch (error) {
      setErrorMessage('Erro na conexão com o servidor.');
    }
  };

  return (
    <div id="webcrumbs" className="flex items-center justify-center h-screen">
      <div className="w-[400px] min-h-[600px] mx-auto bg-gradient-to-r from-neutral-50 to-gray-100 shadow-lg rounded-lg p-8 hover:shadow-2xl transition-shadow duration-300 ease-in-out transform hover:scale-105">
        <h1 className="text-4xl font-title text-center text-purple-600 mb-6 tracking-wide">Login</h1>
        <div className="flex flex-col gap-4">
          <form className="space-y-6" onSubmit={handleSubmit}>
            <div className="space-y-1">
              <label htmlFor="email" className="block text-lg font-medium">Email</label>
              <div className="relative">
                <span className="material-symbols-outlined absolute left-3 top-2 text-purple-300">mail</span>
                <input
                  id="email"
                  type="email"
                  className="w-full px-10 py-3 border border-purple-300 rounded-md focus:outline-none focus:border-purple-500 focus:ring-4 focus:ring-purple-300/50 transition-all duration-300 ease-in-out transform focus:scale-105"
                  placeholder="Your email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                />
              </div>
            </div>

            <div className="space-y-1">
              <label htmlFor="password" className="block text-lg font-medium">Password</label>
              <div className="relative">
                <span className="material-symbols-outlined absolute left-3 top-2 text-purple-300">lock</span>
                <input
                  id="password"
                  type="password"
                  className="w-full px-10 py-3 border border-purple-300 rounded-md focus:outline-none focus:border-purple-500 focus:ring-4 focus:ring-purple-300/50 transition-all duration-300 ease-in-out transform focus:scale-105"
                  placeholder="Your password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
              </div>
            </div>

            {errorMessage && (
              <div className="text-orange-600 text-center">
                <span className="text-sm fade-in">{errorMessage}</span>
              </div>
            )}

            {successMessage && (
              <div className="text-green-600 text-center">
                <span className="text-sm fade-in">{successMessage}</span>
              </div>
            )}

            <button
              type="submit"
              className="w-full px-4 py-3 bg-purple-700 text-neutral-50 rounded-full hover:bg-purple-600 focus:bg-purple-800 transition-transform transform hover:scale-105 duration-300"
            >
              Login
            </button>
          </form>

          <p className="text-sm mt-4 text-center">
            Don't have an account? <a href="#" className="text-purple-600 hover:underline">Create one</a>
          </p>

          <div className="mt-6 text-center space-y-4">
            <a href="#" className="block text-sm text-purple-600 hover:underline">Forgot your password?</a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Login;
